class isLoggedIn extends React.Component{
  constructor(props){
    super(props)
    this.state ={
      isLogin: this.props.isLogin
    }
  }
  render(){
    return (
    
      <Button variant="primary" size="sm" className="navi-text">
  {this.state.isLogin ? '' : 'LOGIN/SIGNUP'}
  </Button>
  )
  }
  
  
}




export default isLoggedIn;
